Hand Carved Woodcut with Digital Color

The color used is from a mini brain (fancy name is "cortical organoid") that was grown from stem cells for 90 days. Stem cells are given supplements that support neural progenitor, neuron, and astrocytes growth. The mini brain was stained using immunofluorescence techniques to look for excitatory synapses under a confocal microscope.

